import "./Post.css";
function Post(props) {
  const { name, rus, continent, capital, population, flag, map } = props;

  return (
    <div className="post">
      <div>{name}</div>
      <div>{rus}</div>
      <div>{capital}</div>
      <div>{continent}</div>
      <div>{population}</div>
      <div>
        <img className="flag" src={flag} />
      </div>
      <div>
        <a href={map} target="_blank">
          Карта
        </a>
      </div>
    </div>
  );
}
export default Post;
